function pdf() {
    var doc = new jsPDF();
    var imgData = "data:image/jpeg;base64,";
    doc.addImage(imgData, 'JPEG',0,0,210,297);
        
    nume = document.getElementById("nume").value;
    rut = document.getElementById("rut").value;
    prov = document.getElementById("prov").value;
    dire = document.getElementById("dire").value;
    comu = document.getElementById("comu").value;
    fono = document.getElementById("fono").value;
    fax = document.getElementById("fax").value;
    aten = document.getElementById("aten").value;
    fecO = document.getElementById("fecO").value;
    term = document.getElementById("term").value;
    mone = document.getElementById("mone").value;
    fecE = document.getElementById("fecE").value;
    
    obsv = document.getElementById("obsv").value;
    
    soli = document.getElementById("soli").value;
    auto = document.getElementById("auto").value;
    
    subt = document.getElementById("subt").value;
    tdct = document.getElementById("tdct").value;
    tnet = document.getElementById("tnet").value;
    iva = document.getElementById("iva").value;
    tbru = document.getElementById("tbru").value;
    
    doc.setFontSize(8);
    doc.setFontType('bold');
    doc.setTextColor(20, 20, 20);
    
    //CABECERA DE LA ORDEN
    doc.text(166, 25, nume);
    //DETALLE DEL PROVEEDOR
    doc.text(40, 67, rut);
    doc.text(40, 71, prov);
    doc.text(40, 75, dire);
    doc.text(40, 80, comu);
    doc.text(40, 84, fono);
    doc.text(40, 89, fax);
    doc.text(40, 93, aten);
    doc.text(166, 67, fecO);
    doc.text(166, 71, term);
    doc.text(166, 75, mone);
    doc.text(166, 80, fecE);
    
    cont = document.getElementById("cont").value;
    
    k = 120;
    //CUERPO DE LA ORDEN
    for (var i = 0; i < cont;) {
        a = document.getElementById(i).value; i = i + 1;
        b = document.getElementById(i).value; i = i + 1; 
        c = document.getElementById(i).value; i = i + 1; 
        d = document.getElementById(i).value; i = i + 1;
        e = document.getElementById(i).value; i = i + 1; 
        f = document.getElementById(i).value; i = i + 1; 
        g = document.getElementById(i).value; i = i + 1; 
        h = document.getElementById(i).value; i = i + 10;
        k = k + 5;
        doc.text(5, k, a);//item
        doc.text(20, k, b);//articulo
        doc.text(102, k, c);//fecha entrega
        doc.text(124, k, d);//cantidad
        doc.text(140, k, e);//precio
        doc.text(158, k, f);//%dcto
        doc.text(172, k, g);//divisa
        doc.text(185, k, h);//total linea
    }
    
    doc.setFontType('normal');
    doc.text(10, 228, obsv);    
    //PIE DE PAGINA
    doc.setFontType('bold');
    doc.text(27, 266, soli);
    doc.text(27, 271, auto);
    //TOTAL
    doc.text(175, 268, subt);
    doc.text(175, 273, tdct);
    doc.text(175, 278, tnet);
    doc.text(175, 282, iva);
    doc.text(175, 287, tbru);
    
    doc.save(nume+'.pdf');
}